import React from 'react';
import './Components.css';

import MainButton from './MainButton';
import imgDLTools from './resources/DLTools.png';
const logopath = 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fm.youtube.com%2Fuser%2FBCNvision%2Fvideos&psig=AOvVaw2rv5KwQVIXYd5_tK6vwbpu&ust=1673025530424000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCNCV-vb3sPwCFQAAAAAdAAAAABAE'

const DeepLearningToolsPage = () => {
  return (
    <div id='panel' className="App-panel">
        <MainButton source={imgDLTools} title={'Deep Learning Tools'} />
    </div>     
  );
}

export default DeepLearningToolsPage;
